import React from "react";
import "fontsource-cascadia-mono";
import { useNavigate } from "react-router-dom";

export default function Shop() {
    let navigate = useNavigate();

    function annualFlowers() {
        navigate("/home/products/Annual-Flowers");
    }
    function gardenPlants() {
        navigate("/home/products/Garden-Plants-&-Flowers");
    }
    function gardenSupplies() {
        navigate("/home/products/Garden-Supplies-&-Plant-Care");
    }
    return (
        <div className="dropdown">
            <button className="dropbtn">SHOP</button>
            <div className="dropdown-content">
                <a href="Annual-Flowers" onClick={() => navigate(annualFlowers)}>Annual Flowers</a>
                <a href="Garden-Plants-&-Flowers" onClick={gardenPlants}>Garden Plants & Flowers</a>
                <a href="Garden-Supplies-&-Plant-Care" onClick={gardenSupplies}>Garden Supplies & Plant Care</a>
            </div>
        </div>
    )
}
